For some applications, such as games, the application will need raw key up/down events rather than the Unicode characters those key events correspond to. For this, there is a device which returns raw key events. Reading from this device is non-blocking. Mapping is performed if the current keyboard layout is non-QWERTY (e.g. the top left letter key on an AZERTY keyboard is Key::LetterA not Key::LetterQ), but you must perform your own handling of shifted characters (for example how Shift + . gives you a > character when using a United Kingdom keyboard layout). The easiest way to handle this is to allow users to map their own keys (e.g. "Press the key you want to use for 'Jump': "). enum Key { LetterA, LetterB, LetterC, LetterD, ... Digit0, Digit1, ... Dot, Comma, PrintScreen, Up, Down, Left, Right, Home, End, Delete, ...
} struct KeyEvent(u8); impl KeyEvent { unsafe fn from_octet(u8) -> KeyEvent; fn is_keydown(&self) -> bool; fn is_keyup(&self) -> bool; fn get_key(&self) -> Key;
} use neotron::fs::File;
let mut kb = File::open("KBD$:").expect("Failed to open raw keyboard");
let buffer = [0u8; 16];
/// The standard file read function is used to read from the keyboard
match kb.read(&mut buffer) { Ok(0) => { println!("No raw key events available"); } Ok(n) => { for octet in buffer[0..n].iter() { let ev = unsafe { KeyEvent::from_octet(octet) }; println!("Received event {:?}", ev); } } Err(e) => { eprintln!("Oh, I got read error {:?} reading from the keyboard", e); }
}
